        return new Source("<!DOCTYPE html>
<html>
    <head>
        <meta charset=\"UTF-8\">
        <title>{% block title %}Welcome!{% endblock %}</title>

        <link href=\"https://cdn.jsdelivr.net/npm/bootstrap@5.0.2/dist/css/bootstrap.min.css\" rel=\"stylesheet\" integrity=\"sha384-EVSTQN3/azprG1Anm3QDgpJLIm9Nao0Yz1ztcQTwFspd3yD65VohhpuuCOmLASjC\" crossorigin=\"anonymous\">

        {# Run `composer require symfony/webpack-encore-bundle`
           and uncomment the following Encore helpers to start using Symfony UX #}
        {% block stylesheets %}
            {#{{ encore_entry_link_tags('app') }}#}
        {% endblock %}

        {% block javascripts %}
            {#{{ encore_entry_script_tags('app') }}#}
            <script src=\"https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js\"></script>
        {% endblock %}
    </head>
    <body style=\"background:#D3D3D3;\">
        <div class=\"container\">

            {% block body %}
                {% for message in app.flashes('success') %}
                    <div class=\"alert alert-success alert-dismissible\" >{{message}}</div>
                {% endfor %}

                <div>
                    <h1>Login</h1>

                    {{form_start(form, {'method': 'POST'})}} {# opening form tags with attrs #}
                    {# form_row gives us complete control on fields #}
                    {# {{form_row(form.name,{
                        label:'User Name'
                    })}} #}
                    {{form_row(form.email,{
                        label:'Enter Email'
                    })}}
                    {{form_row(form.password,{
                        label:'Enter Password'
                    })}}
                    {# {{form_widget(form)}} #} {# Actual Form , a shortcut to use intsead of wrting form_row#}
                    {{form_end(form)}} {# ending form tags #}

                </div>
                <p>Not Registered? Click <a href=\"/signup\">Here</a> to get yourself Registered.</p>

            {% endblock %}
        </div>
        <script src=\"https://cdn.jsdelivr.net/npm/bootstrap@5.0.2/dist/js/bootstrap.bundle.min.js\" integrity=\"sha384-MrcW6ZMFYlzcLA8Nl+NtUVF0sA7MsXsP1UyJoMp4YLEuNSfAP+JcXn/tWtIaxVXM\" crossorigin=\"anonymous\"></script>
    </body>
</html>

